<template>    <view class="mt-[20rpx]">        <view class="text-base font-medium mb-[20rpx]">其它参数</view>        <u-input            type="text"            :cursor-spacing="120"            v-model="value"            maxlength="200"            placeholder="请输入后缀参数"            :customStyle="{                padding: '0 20rpx',                borderRadius: '14rpx',                backgroundColor: '#f5f5f5'            }"        ></u-input>    </view></template><script setup lang="ts">import { computed } from 'vue'const emit = defineEmits<{    (event: 'update:modelValue', value: string): void}>()const props = withDefaults(    defineProps<{        modelValue?: any    }>(),    {        modelValue: ''    })const value = computed({    get: () => {        return props.modelValue    },    set: (val) => {        emit('update:modelValue', val)    }})</script>